import React from "react";
import unsplash from "../../../helpers/unsplash";

const Confirmation= async(props)=>{
    const infoArr=[]
    let obj=props.data
    console.log("OBJ",obj.data)
    for(let key in obj.data){
        console.log("key",key)
        const response=await unsplash.get('/search/photos',{
            params:{
                query:obj[key] },
        })
        console.log('response', response)
        let info=
        <div className="column is-two-fifths">
            <div class="card">
                <div class="card-image">
                    <figure class="image is-2by2">
                        <img src={response.data.results[0].urls.regular} alt="Placeholder image"/>
                    </figure>
                </div>
                <div class="card-content">
                    <div class="content">
                        <h2>{key}</h2><h3>{obj[key]['code']}</h3>
                        <h4> Population:{obj[key]['population']}</h4>
                    </div>
                </div>
            </div>
        </div>
        infoArr.push(info)
    }
    console.log('info',infoArr)
    return(
        <div className="box">
            <h1>He;;o</h1>
        </div>
    )
}

export default Confirmation
